import React, { useState } from 'react';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { FormControl, Container, Typography, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';

const JefeView = ({ onLogout, inventarios = [], handleGuardar, handleEliminar }) => {
  const [formData, setFormData] = useState({
    NoTela: '',
    Talla: '',
    Color: '',
    Estilo: '',
    Estado: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = () => {
    handleGuardar(formData);
    setFormData({
      NoTela: '',
      Talla: '',
      Color: '',
      Estilo: '',
      Estado: ''
    });
  };

  const handleLogout = () => {
    console.log("Sesi贸n cerrada");
    onLogout();
  };

  return (
    <Container maxWidth="sm">
      <Typography variant="h4" gutterBottom>
        Vista del Jefe
      </Typography>
      
      <FormControl fullWidth>
        <TextField 
          label="No Tela" 
          type="text" 
          name="NoTela" 
          value={formData.NoTela} 
          onChange={handleChange} 
          margin="normal" 
        />
        <TextField 
          label="Talla" 
          type="text" 
          name="Talla" 
          value={formData.Talla} 
          onChange={handleChange} 
          margin="normal" 
        />
        <TextField 
          label="Color" 
          type="text" 
          name="Color" 
          value={formData.Color} 
          onChange={handleChange} 
          margin="normal" 
        />
        <TextField 
          label="Estilo" 
          type="text" 
          name="Estilo" 
          value={formData.Estilo} 
          onChange={handleChange} 
          margin="normal" 
        />
        <TextField 
          label="Estado" 
          type="text" 
          name="Estado" 
          value={formData.Estado} 
          onChange={handleChange} 
          margin="normal" 
        />
        <Button 
          variant="contained" 
          color="primary" 
          style={{ marginTop: '20px' }} 
          onClick={handleSubmit}
        >
          Guardar
        </Button>
      </FormControl>

      <Button 
        variant="contained" 
        color="secondary" 
        onClick={handleLogout} 
        style={{ marginTop: '20px' }}
      >
        Cerrar sesi贸n
      </Button>

      <Typography variant="h5" gutterBottom style={{ marginTop: '40px' }}>
        Inventario
      </Typography>
      
      <TableContainer component={Paper} style={{ marginTop: '20px' }}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>No Tela</TableCell>
              <TableCell>Talla</TableCell>
              <TableCell>Color</TableCell>
              <TableCell>Estilo</TableCell>
              <TableCell>Estado</TableCell>
              <TableCell>Acci贸n</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {inventarios.length > 0 ? (
              inventarios.map((inventario, index) => (
                <TableRow key={index}>
                  <TableCell>{inventario.NoTela}</TableCell>
                  <TableCell>{inventario.Talla}</TableCell>
                  <TableCell>{inventario.Color}</TableCell>
                  <TableCell>{inventario.Estilo}</TableCell>
                  <TableCell>{inventario.Estado}</TableCell>
                  <TableCell>
                    <Button 
                      variant="contained" 
                      color="error" 
                      onClick={() => handleEliminar(inventario._id)}
                    >
                      Eliminar
                    </Button>
                  </TableCell>
                </TableRow>
              ))
            ) : (
              <TableRow>
                <TableCell colSpan={6} align="center">No hay inventarios</TableCell>
              </TableRow>
            )}
          </TableBody>
        </Table>
      </TableContainer>
    </Container>
  );
};

export default JefeView;
